CREATE TABLE buildings (
    locations_list INT,
    locations_list_abbreviation VARCHAR(9) CHARACTER SET utf8,
    locations_list_address VARCHAR(76) CHARACTER SET utf8,
    locations_list_campuses_list VARCHAR(16) CHARACTER SET utf8,
    locations_list_categories_list VARCHAR(14) CHARACTER SET utf8,
    locations_list_latitude NUMERIC(18, 16),
    locations_list_longitude NUMERIC(17, 16),
    locations_list_name VARCHAR(50) CHARACTER SET utf8
);
